import {Carousel} from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css"; 
import img from "../assets/img.jpg";

function Home() {
return (
    <section>
        <div className="home">
            <Carousel
                infiniteLoop
                autoPlay
                showStatus={false}
                showThumbs={false}
                showArrows={false}
                interval={1500}
            >
                <div>
                    <img src={img} alt="img" style={{ transform: "rotate(10deg)" }} />
                </div>
                <div>
                    <img
                        src={img}
                        alt="img"
                        style={{ transform: "rotate(-10deg)" }}
                    />
                    {/* <p className="legend">Secure Your Data</p> */}
                </div>
                <div>
                    <img src={img} alt="img" style={{ transform: "rotate(10deg)" }} />
                </div>
                <div>
                    <img src={img} alt="img" style={{ transform: "rotate(-10deg)" }} />
                </div>
            </Carousel>
        </div>

        {/*  */}
    </section>
);
}

export default Home;
